(636, 'penyampaian materi sangat susah dipahami. dosen terlalu banyak menceritakan kejadian pribadi dibanding materi yang sedang diajarkan. slide materi sering dilewati dengan dalih sudah paham yang sebenarnya sama sekali belum dibuka maupun sama sekali tidak paham. saya merasa dosen tidak memahami materi yang diajarkan. penulisan bahasa pada soal ujian sangat sulit untuk dipahami, sebab soal yang ditulis hanyalah seluruh judul dan sub-judul pada suatu bab yang ditambahkan \"jelaskan\" dan \"apa itu\".  saya mohon pahami dengan seksama terlebih dahulu materi yang ingin diajarkan dan cari cara penjelasan yang cukup dimengerti oleh seluruh mahasiswa. mahasiswa yang masuk ke prodi tif ini bukan hanya yang seorang \"geek\" namun orang awam juga.', 'materi sangat susah paham dosen terlalu banyak cerita jadi pribadi banding materi sedang ajar slide materi sering lewat dalih paham benar sama sekali buka maupun sama sekali paham rasa dosen paham materi ajar tulis bahasa soal uji sangat sulit paham soal tulis seluruh judul sub-judul suatu bab tambah jelas apa mohon paham seksama lebih materi ajar cari cara jelas cukup erti seluruh mahasiswa mahasiswa masuk prodi tif bukan orang geek orang awam', 'positif');
