adi apa nanti 5 blan kedepan jokowi sampeyan trs begini, (0 %),waktu ahox akan tumbang pertandanya surah almaidah 51 sekarang giliran jokowi pertandanya pembakaran bendera kalimat tauhid yg dilakukan oleh anggota banser jelas sudah bukti kuat bahwa allah swt punya kuasa segalanya (0 %),dahsyat... pelukan tulus... barakallah pak jokowi (0 %),jokowi terbaik (0 %),saya percaya bapak orang yang baik @jokowi #jadiakusebentarsaja (0 %),kubu mereka anti sama kerendahan hati dan perdamaian..\nsuka nya ribut, makanya buat statement indonesia bakal runtuh.. (0 %),ayolah bung, saya tahu anda pendukung prabowo, tapi apa salahnya satu hari saja anda mengupas tentang kinerja baik jokowi. (0 %),jokowi merupakan figur pemimpin yang komplit. beliau merupakan sosok imam, bapak sekaligus sahabat. sehingga di bawah kepemimpinanya, pembangunan dan masyarakat akan lebih sejahtera (0 %),', '', ''),
